import './App.css';
import React, { useState } from 'react';
function App() {
  var redux = require('redux');
  var oldState ={
    num:["Screen","Mouse","KeyBoard"],
    editStatus:true
  }
  var reducer1 = (state=oldState,action) => {
    switch (action.type) {
      case "CHANGE_EDIT_STATUS":
      return {...state,editStatus:!state.editStatus}
      break;
      case "ADD_NEW_ITEM":
      return {...state,num:[...state.num,action.newItem]}
      break;
    }
    return state;
  }
  var store1 = redux.createStore(reducer1)
  store1.dispatch({type:"CHANGE_EDIT_STATUS"}); // thực thi action
  store1.dispatch({type:"ADD_NEW_ITEM",newItem:"CPU"});
  console.log(store1.getState())
  return (
    <div className="App">

          Learn React
    </div>
  );
}

export default App;
